import { Button, FileUpload, Checkbox, Radio, ToggleBtnGroup } from "intelli-ui-components-library";
import { useEffect, useState } from "react";
import { useAppDispatch, useAppSelector } from "../../store/hooks";
import { uploadFile } from "../../store/reducers/uploadSlice";
import styles from "./apiValidator.module.scss";
import { toastFile } from "../../store/reducers/showToastSlice";
import DemoJson from "../../utils/constant/demo.json";
import { DeleteIcon, UploadIcon, PawIcon } from "../../assets/icons";
import SnackBar from "../snackbar/SnackBar";
import Modals from "../modals/Modals";
import { exportData } from "../../store/reducers/exportSlice";

const ApiValidator = () => {
  const dispatch = useAppDispatch();
  const uploadData = useAppSelector((state) => state.upload);
  const [input, setInput] = useState(uploadData);
  const [invalid, setInvalid] = useState(true);
  const [selectedTab, setSelectedTab] = useState("tab1");
  const [selectValue, setSelectvalue] = useState(false);
  const [modelData, setModelData] = useState({
    title: "",
    description: "",
    onConfirm: () => {},
    showModal: false,
  });

  const handleFileSelect = (file: File) => {
    if (file) {
      const reader = new FileReader();
      reader.onload = (e) => {
        try {
          const jsonData = JSON.parse(e.target.result);
          dispatch(uploadFile(jsonData));
        } catch {
          console.log("Something Wents Worng while reading the file");
        }
      };
      reader.readAsText(file);
    }
  };

  const handleSubmit = () => {
    const data = JSON.parse(input);
    dispatch(uploadFile({ ...data }));
    dispatch(exportData({ ...data }));
    setSelectvalue(true);
  };

  const handleInputChange = (event) => {
    const { value } = event.target;
    setInput(value);
  };

  const handleClear = () => {
    setInput("");
    setModelData({
      title: "",
      description: "",
      onConfirm: () => {},
      showModal: false,
    });
  };
  const handleOnRemoveAll = () => {
    setModelData({
      title: "Are you sure?",
      description:
        "This action will remove properties from the document. Undo will be available.",
      onConfirm: handleClear,
      showModal: true,
    });
  };
  const handleOnCancel = () => {
    setModelData({
      title: "",
      description: "",
      onConfirm: () => {},
      showModal: false,
    });
  };
  const clickHandle = (e: any, val: any) => {
    setSelectedTab(val);
  };
  useEffect(() => {
    try {
      JSON.parse(input);
      setInvalid(false);
      dispatch(
        toastFile({
          message: "JSON Successfully Validated!",
          bgColor: "info",
          isVisible: true,
        })
      );
    } catch (e) {
      setInvalid(true);
      dispatch(
        toastFile({
          message: "Please Upload/Paste Valid JSON File",
          bgColor: "error",
          isVisible: true,
        })
      );
    }
  }, [input]);

  useEffect(() => {
    setInput(JSON.stringify(uploadData, null, 2));
  }, [uploadData]);
  return (
    <>
    <ToggleBtnGroup
        onToggle={clickHandle}
        selectedTab={selectedTab}
        shouldSelectByDefault={true}
        borderBottom={false}
        disabled
        styleObj={{
          bgColor: "#00b8d9",
          borderColor: "#00b8d9",
        }}
      >
        <ToggleBtnGroup.Btn value="tab1">Generate Postman Collection</ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn value="tab2">Run Postman Collection</ToggleBtnGroup.Btn>
      </ToggleBtnGroup>
      { selectedTab=== "tab1" && (
      <div className={styles.container}>
        <div className={`${styles["textarea-container"]}`}>
          <textarea
            onChange={handleInputChange}
            value={input}
            className={`${styles["text-area"]}`}
            name="Open Api Json"
            rows={20}
          />
           <div className={`${styles["button-group"]}`}>
          <Button
            round="round"
            color="success"
            className={styles["button1"]}
            disabled={invalid}
            onClick={handleSubmit}
          >
            <span className={styles["button-icon"]}>
              <UploadIcon fill="#FFFFFF" />
            </span>
            Download
          </Button>
          <Button
            round="round"
            className={styles["button1"]}
            onClick={handleSubmit}
          >
            <span className={styles["button-icon"]}>
              <PawIcon fill="#FFFFFF" width="16px" height="16px" />
            </span>
            Generate
          </Button>
          <Button
            round="round"
            className={styles["button"]}
            disabled={!input}
            onClick={handleOnRemoveAll}
          >
            <span className={styles["button-icon"]}>
              <DeleteIcon fill="#FFFFFF" width="16px" height="16px" />
            </span>
            REMOVE ALL
          </Button>
          {modelData.showModal && (
            <Modals
              showModal={modelData.showModal}
              header={modelData.title}
              description={modelData.description}
              onConfirm={modelData.onConfirm}
              onCancel={handleOnCancel}
              childClassName=""
            />
          )}
          <FileUpload
            fileInputClass={styles.fileUpload}
            onFileSelect={handleFileSelect}
            fileType=".json"
          />
        </div>
        </div>
       
      </div>
      )}
      { selectedTab === "tab2" && (
      <div className={styles.container}>
       <div className={`${styles["textarea-container"]}`}>
        <div className={styles.runpostman}>
          { selectValue === true && (
          <div className={styles.runpostman}>
           <div className={styles.itemCenter}>
            <Radio label="Select Postman Collection" size="sm"/>
            <p style={{marginLeft:"20px",marginTop:"8px" }}>New Genrated Filename</p>
           </div>
           <p className={styles.itemDist}>Or</p>
          </div>
          )}
          <div className={styles.runpostman}>
          <div className={styles.itemCenter}>
          <Radio label="Upload Postman Collection" size="sm"/>
          <FileUpload
            fileInputClass={styles.fileUpload}
            onFileSelect={handleFileSelect}
            fileType=".json"
          />
          </div>
          <div className={`${styles["button-group1"]}`}>
          <Button
            round="round"
            className={styles["button1"]}
            onClick={handleSubmit}
          >
            <span className={styles["button-icon"]}>
              <PawIcon fill="#FFFFFF" width="16px" height="16px" />
            </span>
            Run
          </Button>
          <Button
            round="round"
            color="success"
            className={styles["button1"]}
            disabled={invalid}
            onClick={handleSubmit}
          >
            <span className={styles["button-icon"]}>
              <UploadIcon fill="#FFFFFF" />
            </span>
            View Report
          </Button>
          <Button
            round="round"
            color="success"
            className={styles["button1"]}
            disabled={invalid}
            onClick={handleSubmit}
          >
            <span className={styles["button-icon"]}>
              <UploadIcon fill="#FFFFFF" />
            </span>
            Download Report
          </Button>
          </div>
          {modelData.showModal && (
            <Modals
              showModal={modelData.showModal}
              header={modelData.title}
              description={modelData.description}
              onConfirm={modelData.onConfirm}
              onCancel={handleOnCancel}
              childClassName=""
            />
          )}
          </div>
        </div>
       </div>
       
      </div>
      )}
      <SnackBar />
    </>
  );
};

export default ApiValidator;
